import React from "react";

import Header from "./Header";
import Footer from "./Footer";

function Users() {
  return (
    <div>
      <Header />

      <div class="menu">
          <div><a class="links" href="/users/register">Cadastrar<br/>Usuário</a></div>
          <div><a class="links" href="/users/list">Buscar<br/>Usuários</a></div>
    </div>

      <Footer />
    </div>
  );
}

export default Users;
